from selenium.webdriver.common.by import By
from selenium.webdriver.common.keys import Keys
import pyperclip
from cases.regression.minus.data.Data_presentation import *
from mioAuto.common.buildBrowser import buildBrowser
from mioAuto.common.decos import dataProvider
from mioAuto.common.request import Request
from cases.regression import browserInfo
from mioAuto.core.BrowserCase import BrowserCase

class Test_presentation(BrowserCase, TestCase):
    @classmethod
    def setUpClass(cls):
        browserInfo.initPage = 'https://{}.miotech.com/ami/home'.format(ENV)
        cls.browser = buildBrowser(browserInfo)
        cls.request = Request(browserInfo.cookie)
        resp = cls.request.post('https://{}.miotech.com/api/ami/snapshot-create'.format(ENV),{"snapshotName":"aaaa","projectId":"29994550-f93b-4d43-ad64-192593d85a96","snapshotFileInfo":{"fileName":"131f129d-5177-c755-d496-c278b8caa716.png","fileSize":1010300,"snapshotData":""}}).data.json()
        cls.idss = resp['result']['snapshotId']

    @dataProvider(data)
    def test_presentation(self, input, exp):
        """
        check the presentation
        """
        self.doStep(self.browser, input, exp)
    def test_share(self):
        """
        check the share link
        """
        self.browser.get(pyperclip.paste())
        time.sleep(3)
        self.assertEqual(self.browser.find_element_by_xpath('//*[@id="react-root-placeholder"]/div/div/div/div[1]/div/div[2]').text,'aaaa')


    @classmethod
    def tearDownClass(cls):
        cls.request.post("https://{}.miotech.com/api/ami/snapshot-remove".format(ENV), {'snapshotId':[cls.idss]})
        cls.browser.close()
